  [],\n\t\"num_tags\": 0,\n\t\"name\": \"attributes-for-mrb-e2rf1-catchments-by-major-river-basins-in-the-conterminous-united-1971-2000\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This tabular data set represents the 30-year
  (1971-2000) catchment-average total annual precipitation in millimeters multiplied
  by 100 compiled for every MRB_E2RF1 catchment of selected Major River Basins (MRBs,
  Crawford and others, 2006). The source data were the United States Average Monthly
  or Annual Minimum Precipitation, 1971 - 2000 raster data set produced by the PRISM
  Group at Oregon State University. The MRB_E2RF1 catchments are based on a modified
  version of the Environmental Protection Agency's (USEPA) ERF1_2 and include enhancements
  to support national and regional-scale surface-water quality modeling (Nolan and
  others, 2002; Brakebill and others, 2011). Data were compiled for every MRB_E2RF1
  catchment for the conterminous United States covering New England and Mid-Atlantic
  (MRB1), South Atlantic-Gulf and Tennessee (MRB2), the Great Lakes, Ohio, Upper Mississippi,
  and Souris-Red-Rainy (MRB3), the Missouri (MRB4), the Lower Mississippi, Arkansas-White-Red,
  and Texas-Gulf (MRB5), the Rio Grande, Colorado, and the Great basin (MRB6), the
  Pacific Northwest (MRB7) river basins, and California (MRB8).\",\n\t\"owner_org\":
